  false,\n\t\"url\": null,\n\t\"notes\": \"The Rappahannock River Valley National
  Wildlife Refuge was first opened for recreational fishing in 2003. Wilna Pond was
  the only site suitable for this activity at that time. Since then, additional land
  acquisitions have resulted in three more areas that are suitable to support public
  recreational fishing. They include Laurel Grove Pond, Mt. Landing Creek from the
  Hutchinson Tract, and the Rappahannock River from the Tobyu2019s Point Tract. This
  plan details each of these tracts and provides input on incorporating public fishing
  as a recreational vehicle on these areas of the refuge.\",\n\t\"license_title\":
